import React from 'react'

export class Clock extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            date: new Date().toLocaleString
        }
    }

    render(){
        return(
            <div>
                <h4>{this.state.date}</h4>
            </div>
        );
    }
}
